function Vid() {
    return (
        <div className="main_vid">
        <header className="title-playing">Golu</header>
        <div className="play-area">
            <video width="900" controls>
            <source src="frntend/public/test1.mp4" type="video/mp4" />
            Your browser does not support the video tag.
            </video>
        </div>
        </div>
    );
}

export default Vid;
